import React from 'react';
import Feed from '/components/Feed';

const CategoryPage = ({ articles }) => {
  return (
    <div>
      {articles.map((item, i) => (
        <Feed
          key={i}
          content={item.content}
          contentSnippet={item.contentSnippet}
          title={item.title}
          link={item.link}
          date={item.pubDate}
        />
      ))}
    </div>
  );
};

export default CategoryPage;
